import React, { useEffect, useRef } from 'react';
import { gsap } from 'gsap';

interface ThreeDModelProps {
  className?: string;
}

export default function ThreeDModel({ className = '' }: ThreeDModelProps) {
  const containerRef = useRef<HTMLDivElement>(null);
  const capsulesRef = useRef<(HTMLDivElement | null)[]>([]);

  useEffect(() => {
    if (!containerRef.current || capsulesRef.current.length === 0) return;

    const validCapsules = capsulesRef.current.filter(Boolean) as HTMLDivElement[];
    if (validCapsules.length === 0) return;

    // Animate capsules on mount with GSAP
    const tl = gsap.timeline({ defaults: { ease: 'power2.out' } });

    validCapsules.forEach((capsule, index) => {
      // Set initial state
      gsap.set(capsule, {
        opacity: 0,
        scale: 0.7,
        y: 30,
        transformOrigin: '50% 100%', // Transform from bottom center
      });

      // Animate in with stagger
      tl.to(
        capsule,
        {
          opacity: 1,
          scale: 1,
          y: 0,
          duration: 1.2,
          ease: 'back.out(1.2)',
        },
        index * 0.1
      );
    });

    // Continuous subtle floating animation
    validCapsules.forEach((capsule, index) => {
      const floatAmount = 6 + Math.sin(index) * 3;
      gsap.to(capsule, {
        y: -floatAmount,
        rotation: Math.sin(index) * 2,
        duration: 3 + index * 0.3,
        repeat: -1,
        yoyo: true,
        ease: 'sine.inOut',
        delay: index * 0.2,
      });
    });

    // Mouse interaction for 3D effect
    const handleMouseMove = (e: MouseEvent) => {
      if (!containerRef.current) return;
      const rect = containerRef.current.getBoundingClientRect();
      const centerX = rect.left + rect.width / 2;
      const centerY = rect.top + rect.height / 2;
      const deltaX = (e.clientX - centerX) / rect.width;
      const deltaY = (e.clientY - centerY) / rect.height;

      validCapsules.forEach((capsule, index) => {
        const rotateY = deltaX * 12;
        const rotateX = -deltaY * 8;
        const scale = 1 + Math.abs(deltaX) * 0.05;
        
        gsap.to(capsule, {
          rotationY: rotateY,
          rotationX: rotateX,
          scale: scale,
          duration: 1.2,
          ease: 'power2.out',
        });
      });
    };

    // Reset on mouse leave
    const handleMouseLeave = () => {
      validCapsules.forEach((capsule) => {
        gsap.to(capsule, {
          rotationY: 0,
          rotationX: 0,
          scale: 1,
          duration: 1,
          ease: 'power2.out',
        });
      });
    };

    containerRef.current.addEventListener('mousemove', handleMouseMove);
    containerRef.current.addEventListener('mouseleave', handleMouseLeave);

    return () => {
      containerRef.current?.removeEventListener('mousemove', handleMouseMove);
      containerRef.current?.removeEventListener('mouseleave', handleMouseLeave);
    };
  }, []);

  // Create 7 capsules arranged in a fan pattern radiating from bottom center
  const capsuleCount = 7;
  const startAngle = -150; // Left side angle
  const endAngle = -30; // Right side angle
  const angleSpread = endAngle - startAngle;
  const radius = 100; // Distance from center

  const capsules = Array.from({ length: capsuleCount }, (_, i) => {
    const angle = startAngle + (angleSpread / (capsuleCount - 1)) * i;
    const radian = (angle * Math.PI) / 180;
    const x = Math.cos(radian) * radius;
    const y = Math.sin(radian) * radius;
    const rotation = angle + 90; // Rotate capsule to align with radial direction

    return { x, y, rotation, index: i };
  });

  return (
    <div
      ref={containerRef}
      className={`relative w-full h-full flex items-center justify-center ${className}`}
      style={{
        perspective: '1200px',
        perspectiveOrigin: '50% 50%',
        minHeight: '320px',
      }}
    >
      <div
        className="relative"
        style={{
          width: '400px',
          height: '320px',
          transformStyle: 'preserve-3d',
        }}
      >
        {capsules.map((capsule, index) => (
          <div
            key={index}
            ref={(el) => {
              capsulesRef.current[index] = el;
            }}
            className="absolute"
            style={{
              left: '50%',
              bottom: '0%',
              transform: `translateX(-50%) translate3d(${capsule.x}px, ${-capsule.y}px, 0) rotateZ(${capsule.rotation}deg)`,
              transformStyle: 'preserve-3d',
            }}
          >
            {/* 3D Capsule - Pill shaped */}
            <div
              className="relative"
              style={{
                width: '45px',
                height: '160px',
                transformStyle: 'preserve-3d',
              }}
            >
              {/* Main body with white-to-blue-to-white gradient */}
              <div
                style={{
                  width: '45px',
                  height: '160px',
                  borderRadius: '22.5px',
                  background: `linear-gradient(180deg, 
                    #FFFFFF 0%, 
                    #F8FBFF 8%,
                    #E0F2FE 25%,
                    #7DD3FC 40%,
                    #38BDF8 50%,
                    #0EA5E9 60%,
                    #0284C7 70%,
                    #7DD3FC 85%,
                    #E0F2FE 92%,
                    #FFFFFF 100%
                  )`,
                  boxShadow: `
                    0 10px 20px rgba(0, 0, 0, 0.12),
                    0 5px 10px rgba(0, 0, 0, 0.08),
                    inset -12px 0 25px rgba(255, 255, 255, 0.4),
                    inset 12px 0 25px rgba(0, 0, 0, 0.08),
                    inset 0 -5px 15px rgba(59, 130, 246, 0.2)
                  `,
                  border: '1px solid rgba(255, 255, 255, 0.4)',
                  position: 'relative',
                  overflow: 'hidden',
                }}
              >
                {/* Left side specular highlight */}
                <div
                  style={{
                    position: 'absolute',
                    left: '8%',
                    top: '5%',
                    width: '35%',
                    height: '90%',
                    background: 'linear-gradient(90deg, rgba(255, 255, 255, 0.7), rgba(255, 255, 255, 0.1), transparent)',
                    borderRadius: '22.5px',
                    filter: 'blur(6px)',
                  }}
                />
                
                {/* Center inner glow */}
                <div
                  style={{
                    position: 'absolute',
                    left: '50%',
                    top: '25%',
                    transform: 'translateX(-50%)',
                    width: '70%',
                    height: '50%',
                    background: 'radial-gradient(ellipse, rgba(255, 255, 255, 0.5), transparent 70%)',
                    borderRadius: '50%',
                  }}
                />

                {/* Right side shadow */}
                <div
                  style={{
                    position: 'absolute',
                    right: '5%',
                    top: '10%',
                    width: '20%',
                    height: '80%',
                    background: 'linear-gradient(90deg, transparent, rgba(0, 0, 0, 0.15))',
                    borderRadius: '22.5px',
                  }}
                />
              </div>

              {/* Soft shadow underneath */}
              <div
                style={{
                  position: 'absolute',
                  left: '50%',
                  top: '100%',
                  transform: 'translateX(-50%)',
                  width: '35px',
                  height: '10px',
                  background: 'radial-gradient(ellipse, rgba(0, 0, 0, 0.25), transparent 70%)',
                  borderRadius: '50%',
                  filter: 'blur(8px)',
                  zIndex: -1,
                }}
              />
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
